  supplier_name       VARCHAR2(30),
  contact_information VARCHAR2(50),
  inventory           NUMBER(10,2)
)
;
alter table SUPPLIER
  add primary key (SUPPLIER_ID);

prompt Creating INVOICE...
create table INVOICE
